- **Configuraci√≥n del puerto:** Establecemos el puerto serie con `Serial.begin(115200)`.
- **Inicializaci√≥n de DallasTemperature:** `sensors.begin();` inicia el sensor y busca autom√°ticamente todos los sensores OneWire presentes en el bus.
- **Loop:** En cada iteraci√≥n, `sensors.requestTemperatures();` solicita temperaturas a todos los sensores. Luego, se itera sobre los dispositivos y se imprimen las direcciones y las temperaturas en Celsius.
- **Tiempo de espera:** Se incluye un `delay(3000);` para que el programa no sea demasiado agresivo con el bus OneWire y permita a los otros dispositivos responder.

**Puntos a considerar:**
- Aseg√∫rate de que los pines del ESP32 y los sensores est√©n correctamente conectados seg√∫n tu placa.
- Verifica que el n√∫mero de puerto serie (`ONE_WIRE_BUS`) est√© correcto para tu configuraci√≥n.
- El c√≥digo asume que los sensores est√°n disponibles en la direcci√≥n 0x28 (40 en decimal). Si tus sensores tienen direcciones diferentes, ajusta el c√≥digo para corresponder.

