 Claro, aqu√≠ tienes el algoritmo de ordenamiento por inserci√≥n implementado en C. Este algoritmo se conoce como "bubble sort" debido a la forma en que se despliega el proceso de ordenamiento.

```c
#include <stdio.h>

// Funci√≥n para realizar el bubble sort
void bubbleSort(int arr[], int n) {
    int i, j;
    for (i = 0; i < n-1; i++) {
        for (j = 0; j < n-i-1; j++) {
            // Si el elemento actual es mayor que el siguiente, intercambian sus valores
            if (arr[j] > arr[j+1]) {
                int temp = arr[j];
                arr[j] = arr[j+1];
                arr[j+1] = temp;
            }
        }
    }
}

// Funci√≥n para imprimir el arreglo
void printArray(int arr[], int size) {
    int i;
    for (i=0; i < size; i++)
        printf("%d ", arr[i]);
    printf("\n");
}

// Programa principal
int main() {
    int arr[] = {64, 34, 25, 12, 22, 11, 90};
    int n = sizeof(arr)/sizeof(arr[0]);
    bubbleSort(arr, n);
    printf("Arreglo ordenado: \n");
    printArray(arr, n);
    return 0;
}
```

Este programa define una funci√≥n `bubbleSort` que toma un arreglo de enteros y su tama√±o como argumentos. La funci√≥n itera sobre el arreglo y compara cada elemento con el siguiente. Si el elemento actual es mayor que el siguiente, los intercambia de lugar. Este proceso se repite hasta que el arreglo se ordene completamente.

La funci√≥n `printArray` se utiliza para imprimir el arreglo ordenado en la consola.

